import React, {Component} from 'react';
import Carousel from 'react-elastic-carousel';
import './style/corouselCards.css';
import Item from '../components/itemCorousel'
import userThree from '../assets/img/users/user3.png';

const breakPoints = [
    {width:1, itemToShow:1},
    {width:550, itemToShow:2},
    {width:768, itemToShow:3},
    {width:1200, itemToShow:4}
]
class CorouselCards extends Component{

    render(){
        return(
            <div>
     <h1 style={{ textAlign: "center" }}>Example to setup your carousel in react</h1>
      <div className="App">
        <Carousel breakPoints={breakPoints}>
          <Item>One</Item>
          <Item>Two</Item>
          <Item>Three</Item>
          <Item>Four</Item>
          <Item>Five</Item>
          <Item>Six</Item>
          <Item>Seven</Item>
          <Item>Eight</Item>
        </Carousel>
      </div>
            </div>
        )
    }

}

export default CorouselCards;
